import React, { Component } from 'react';

class UserListing extends Component {
    render() {
        const iconStyle = {
            width: 18,
            height: 18
          }

        return (
            <div>
                <form className="form-inline" key={user.id}>
                    <a title={"Delete " + user.firstName + " " + user.lastName} onClick={() => this.deleteUser(user.id)} className="mx-2"><img style={iconStyle} src={Delete} /></a>
                    <a data-toggle="modal" data-target="#editUser" onClick={() => this.editUser(user)} value={user} className="mx-2"><img style={iconStyle} src={Edit} /></a>
                    <span className="text-muted mx-2">{user.id}: {user.firstName} {user.lastName}</span>
                </form>
                <EditUser user={this.state.currentEditUser} address={this.state.currentEditUserAddress}/>
            </div>
        );
    }
}

export default UserListing;
